import React from 'react';
import Link from 'next/link';
import { Button } from 'antd';


const Buttons = () => {
  return (
    <>
      <Button type="primary" href="https://opentutorials.org/course/1" target="_blank" icon="" style={{width: '500px', marginTop: '50px', height: '100px', backgroundColor:'#E6FFFF', borderColor: '#0366d6', borderRadius: '10px', color: 'black'}}>
          <img src="https://user-images.githubusercontent.com/39295881/72589647-2d107e80-393f-11ea-9f03-d8a7605841f4.png" style={{ width: '30px', verticalAlign: 'center'}}/>
          생활코딩
          생활코딩은 일반인들에게 프로그래밍을 알려주는 무료 온라인, 오프라인 수업입니다. 
      </Button>
    </>
  )
}


export default Buttons;
